window.bookSummaryJSON = "<p>When nature warrior Hannah McIntyre goes missing in the Rocky Mountains, her brother organizes a search and rescue team. Killian Devereaux, a former military special-ops soldier who now works for a private security company, leads the mission. Killian grew up in the Louisiana bayou hunting gators and Diamondback rattlers. Searching the mountain forest for a missing woman is right up his alley. He's determined to find her because one thing is certain - Hannah haunts his dreams, and he's not about to give up on her.</p>"; 
